create table cliente (
	id INT Identity(1,1) primary key,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	birth_date DATE,
	id_codigo_postal int FOREIGN KEY REFERENCES codigo_postal(id)
	
);

update cliente
set 
id_codigo_postal = otherTable.id
from 
(select id, row_number() over (order by newid()) as row_num from cliente) tableWithRownum
,(select id, row_number() over (order by newid()) as row_num from codigo_postal) as otherTable
where 
cliente.id=tableWithRownum.id
and (tableWithRownum.row_num)=otherTable.row_num%1000 /*match by row number;*/
/* optional: correct for different table sizes with modulo operation*/